/** @format */
import React, {  useReducer, useState } from "react";
import { useNavigate } from "react-router-dom";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";
import axios from "axios";

import "./App.css";

const baseUrl = "http://localhost:8080";

const style = {
  position: "absolute",
  top: "40%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 400,
  bgcolor: "background.paper",
  boxShadow: 24,
  p: 4,
  textAlign: "center",
};

const AppModal = ({ open, handleClose, title, description, children }) => {
  return (
    <Modal
      open={open}
      handleClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <Box sx={style}>
        <Typography id="modal-modal-title" variant="h6" component="h2">
          {title}
        </Typography>
        <Typography id="modal-modal-description" sx={{ mt: 2 }}>
          {description}
        </Typography>
        <div>{children}</div>
      </Box>
    </Modal>
  );
};

const Content = () => {
  const [open, setOpen] = useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);
  const navigate = useNavigate();
  const [formInput, setFormInput] = useReducer(
    (state, newState) => ({ ...state, ...newState }),
    {
      symptom: "",
      gender: "",
      year_of_birth: "",
      token:
        "eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..0_x9eDbRy0gdgFr2S1Temdg5LM9ricgv9AS7dCD__gw",
    }
  );

  const handleSubmit = (e) => {
    e.preventDefault();

    const data = { formInput };

    axios
      .post(`${baseUrl}/diagonise`, {
        data,
        headers: { "content-type": "application/json" },
      })
      .then((res) => console.log(res, "response"))
      .catch((e) => (e, "Error"));
  };

  const handleInput = (evt) => {
    const name = evt.target.name;
    const newValue = evt.target.value;
    setFormInput({ [name]: newValue });
  };

  return (
    <div className="form">
      <form onSubmit={handleSubmit}>
        <div className="input_field">
          <div className="input__field__value">
            <TextField
              id="outlined-basic"
              label="Symptom"
              variant="outlined"
              style={{ width: "40rem" }}
              onChange={handleInput}
              autoComplete="off"
              name="symptom"
            />
          </div>
          <div className="input__field__value">
            <TextField
              id="outlined-basic"
              label="Gender"
              variant="outlined"
              text-field
              style={{ width: "40rem" }}
              onChange={handleInput}
              autoComplete="off"
              name="gender"
            />
          </div>
          <div className="input__field__value">
            <div>
              <TextField
                id="outlined-basic"
                label="Year of Birth"
                variant="outlined"
                text-field
                style={{ width: "40rem" }}
                onChange={handleInput}
                autoComplete="off"
                name="year_of_birth"
				type="number"
              />{" "}
            </div>
          </div>
        </div>
        <div className="btn">
          <Button
            onClick={handleOpen}
            variant="contained"
            size="large"
            type="submit"
          >
            diagnose
          </Button>
        </div>
      </form>

      <div>
        <AppModal
          title="Your result is ready!"
          description="Please proceed to next steps to view details"
          open={open}
        >
          <div className="modal__close">
            <button className="modal__btn-close" onClick={handleClose}>
              close
            </button>
          </div>
          <div>
            <Button onClick={() => navigate("/result")} variant="contained">
              proceed
            </Button>
          </div>
        </AppModal>
      </div>
    </div>
  );
};


formInput.propTypes = {
	symptom: PropTypes
}

function App() {
  return (
    <div className="App">
      <div className="header">
        <h1>The best place to diagnose your health</h1>
      </div>

      <Content />
    </div>
  );
}

export default App;
